</p>



<span id="example-requests-POSTapi-auth-login">
<blockquote>Example request:</blockquote>


<div class="bash-example">
    <pre><code class="language-bash">curl --request POST \
    "https://jobclass.laraclassifier.local/api/auth/login" \
    --header "Content-Type: application/json" \
    --header "Accept: application/json" \
    --header "Content-Language: en" \
    --header "X-AppApiToken: a25ydDlKdDRwT2wzYjAxV1hvc0hSUmQxYklTTE1pRHU=" \
    --header "X-AppType: docs" \
    --data "{
    \"email\": \"user@demosite.com\",
    \"password\": \"123456\",
    \"auth_field\": \"email\",
    \"phone\": null,
    \"phone_country\": null,
    \"captcha_key\": \"et\"
}"
</code></pre></div>


<div class="javascript-example">
    <pre><code class="language-javascript">const url = new URL(
    "https://jobclass.laraclassifier.local/api/auth/login"
);

const headers = {
    "Content-Type": "application/json",
    "Accept": "application/json",
    "Content-Language": "en",
    "X-AppApiToken": "a25ydDlKdDRwT2wzYjAxV1hvc0hSUmQxYklTTE1pRHU=",
    "X-AppType": "docs",
};

let body = {
    "email": "user@demosite.com",
    "password": "123456",
    "auth_field": "email",
    "phone": null,
    "phone_country": null,
    "captcha_key": "et"
};

fetch(url, {
    method: "POST",
    headers,
    body: JSON.stringify(body),
}).then(response =&gt; response.json());</code></pre></div>


<div class="php-example">
    <pre><code class="language-php">$client = new \GuzzleHttp\Client();
$url = 'https://jobclass.laraclassifier.local/api/auth/login';
$response = $client-&gt;post(
    $url,
    [
        'headers' =&gt; [
            'Content-Type' =&gt; 'application/json',
            'Accept' =&gt; 'application/json',
            'Content-Language' =&gt; 'en',
            'X-AppApiToken' =&gt; 'a25ydDlKdDRwT2wzYjAxV1hvc0hSUmQxYklTTE1pRHU=',
            'X-AppType' =&gt; 'docs',
        ],
        'json' =&gt; [
            'email' =&gt; 'user@demosite.com',
            'password' =&gt; '123456',
            'auth_field' =&gt; 'email',
            'phone' =&gt; null,
            'phone_country' =&gt; null,
            'captcha_key' =&gt; 'et',
        ],
    ]
);
$body = $response-&gt;getBody();
print_r(json_decode((string) $body));</code></pre></div>

