<div class="javascript-example">
    <pre><code class="language-javascript">const url = new URL(
    "https://jobclass.laraclassifier.local/api/companies/1"
);

const headers = {
    "Authorization": "Bearer {YOUR_AUTH_TOKEN}",
    "Content-Type": "multipart/form-data",
    "Accept": "application/json",
    "Content-Language": "en",
    "X-AppApiToken": "a25ydDlKdDRwT2wzYjAxV1hvc0hSUmQxYklTTE1pRHU=",
    "X-AppType": "docs",
};

const body = new FormData();
body.append('company[name]', 'aspernatur');
body.append('company[description]', 'optio');
body.append('company[0][country_code]', 'US');
body.append('company[0][name]', 'Foo Inc');
body.append('company[0][description]', 'Nostrum quia est aut quas. Consequuntur ut quis odit voluptatem laborum quia.');
body.append('company[0][city_id]', '2');
body.append('company[0][address]', '5 rue de l'Echelle');
body.append('company[0][phone]', '+17656766467');
body.append('company[0][fax]', '+80159266712');
body.append('company[0][email]', 'contact@domain.tld');
body.append('company[0][website]', 'https://domain.tld');
body.append('company[0][facebook]', 'officiis');
body.append('company[0][twitter]', 'rerum');
body.append('company[0][linkedin]', 'et');
body.append('company[0][pinterest]', 'quos');
body.append('company[][logo]', document.querySelector('input[name="company[][logo]"]').files[0]);

fetch(url, {
    method: "PUT",
    headers,
    body,
}).then(response =&gt; response.json());</code></pre></div>


